import React, { Component } from "react";
import { StyleSheet, View, ImageBackground, Text } from "react-native";
import FontAwesomeIcon from "react-native-vector-icons/FontAwesome";
import MaterialUnderlineTextbox from "../components/MaterialUnderlineTextbox";
import IoniconsIcon from "react-native-vector-icons/Ionicons";
import MaterialButtonViolet from "../components/MaterialButtonViolet";

function Untitled(props) {
  return (
    <View style={styles.container}>
      <ImageBackground
        style={styles.rect}
        imageStyle={styles.rect_imageStyle}
        source={require("../assets/images/Gradient_DpxnLje.png")}
      >
        <Text style={styles.mangym}>MANGYM</Text>
        <View style={styles.iconRow}>
          <FontAwesomeIcon name="user-o" style={styles.icon}></FontAwesomeIcon>
          <MaterialUnderlineTextbox
            inputStyle="Placeholder"
            inputStyle="User"
            style={styles.materialUnderlineTextbox2}
          ></MaterialUnderlineTextbox>
        </View>
        <View style={styles.icon2Row}>
          <IoniconsIcon name="ios-lock" style={styles.icon2}></IoniconsIcon>
          <MaterialUnderlineTextbox
            inputStyle="Placeholder"
            inputStyle="Password"
            style={styles.materialUnderlineTextbox1}
          ></MaterialUnderlineTextbox>
        </View>
        <MaterialButtonViolet
          caption="Login"
          style={styles.materialButtonViolet}
        ></MaterialButtonViolet>
        <Text style={styles.loremIpsum}>Forgot your password?</Text>
        <Text style={styles.signUp}>SIGN UP</Text>
      </ImageBackground>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1
  },
  rect: {
    width: 375,
    height: 789,
    marginTop: 33
  },
  rect_imageStyle: {},
  mangym: {
    fontFamily: "roboto-500",
    color: "#121212",
    height: 55,
    width: 213,
    fontSize: 45,
    textAlign: "center",
    marginTop: 123,
    marginLeft: 73
  },
  icon: {
    color: "rgba(0,0,0,1)",
    fontSize: 25,
    height: 25,
    width: 21,
    marginTop: 18
  },
  materialUnderlineTextbox2: {
    height: 43,
    width: 219,
    overflow: "visible",
    borderWidth: 0,
    borderColor: "#000000",
    borderStyle: "solid",
    marginLeft: 22
  },
  iconRow: {
    height: 43,
    flexDirection: "row",
    marginTop: 90,
    marginLeft: 49,
    marginRight: 64
  },
  icon2: {
    color: "rgba(0,0,0,1)",
    fontSize: 30,
    height: 33,
    width: 19,
    marginTop: 10
  },
  materialUnderlineTextbox1: {
    height: 43,
    width: 219,
    overflow: "visible",
    borderWidth: 0,
    borderColor: "#000000",
    borderStyle: "solid",
    marginLeft: 22
  },
  icon2Row: {
    height: 43,
    flexDirection: "row",
    marginTop: 46,
    marginLeft: 51,
    marginRight: 64
  },
  materialButtonViolet: {
    height: 45,
    width: 263,
    borderWidth: 0,
    borderColor: "#000000",
    borderRadius: 17,
    backgroundColor: "rgba(43,47,47,1)",
    marginTop: 40,
    marginLeft: 56
  },
  loremIpsum: {
    fontFamily: "roboto-regular",
    color: "rgba(74,74,74,1)",
    fontSize: 15,
    marginTop: 42,
    marginLeft: 112
  },
  signUp: {
    fontFamily: "roboto-regular",
    color: "rgba(74,74,74,1)",
    fontSize: 17,
    textAlign: "center",
    marginTop: 32,
    marginLeft: 156
  }
});

export default Untitled;
